import React from 'react';

const About = () => {
  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">About Us</h1>
      <div className="about-content">
        <p>Welcome to Rental Apartments, your premier destination for finding the perfect place to call home. Our mission is to provide you with a seamless and enjoyable experience in your search for the ideal apartment.</p>
        <img src="https://example.com/about-image.jpg" alt="About Image" />
      </div>
    </div>
  );
};

export default About;
